You can terminate a C program by using the `exit()` function. This function takes an argument which specifies the exit status code. The exit status code is a value that is returned to the parent process when a child process terminates. The value can be used to indicate the reason for the termination, such as a successful execution or an error.

Here's an example of how to use the `exit()` function to terminate a C program:
```
#include <stdio.h>

int main() {
    printf("Hello, world!\n");
    exit(0);
}
```
In this example, the `exit()` function is called with an argument of `0`, which indicates a successful execution. When the program terminates, the value of the exit status code will be `0`.

You can also use the `exit()` function to terminate a program with an error code. For example:
```
#include <stdio.h>

int main() {
    printf("Error: %s\n", "This is an error message");
    exit(1);
}
```
In this example, the `exit()` function is called with an argument of `1`, which indicates an error. When the program terminates, the value of the exit status code will be `1`.

It's important to note that the `exit()` function is a standard C library function, so it is available on most systems. However, some operating systems may have different ways of terminating a program, so it's always a good idea to check the documentation for the specific system you are using.</s>
